import React, {Component} from 'react';
import {Bar, Line} from 'react-chartjs-2';
import Container from 'react-bootstrap/Container'

class Stat_bar extends Component{

    componentDidMount(){
        console.log("works");
    }

    render(){
        return(
            <Container>
                <Row>
                    <Col>1</Col>
                    <Col>2</Col>
                    <Col>3</Col>
                </Row>
            </Container>
        )
    }
}

export default Stat_bar;
